import React from "react";
import 'C:\\Users\\Mysterious\\Youtubelite\\frontend\\src\\resources\\main.css'
import { Logo } from "../Component/Logo/Logo";
import { Admin } from "../Component/Admin/Admin";
import image from "C:\\Users\\Mysterious\\Youtubelite\\frontend\\src\\public\\icon.svg"
import avt from "C:\\Users\\Mysterious\\Youtubelite\\frontend\\src\\public\\avt.png"
import { Dropdown } from "../Component/Admin/Admin.style";
const Homepage = () => {

    return (
        <div className ="home">
    
            <div className = "header" >
                
                <div className = "Logo"> 
                <Logo image={image}/>
                <Dropdown/>
                </div>
              
               <div className = "searchbar">
                 <div className="searchicon"></div> 
                 <div className="inputserach"></div>
                 <div className="inputdelete"></div> 
               </div>

               <div className = "admin">
                   <Admin avt = {avt}/> 

                </div>

            </div>

            <div className = "content">

            </div>

        </div>
    )
}

export default Homepage;
